  ALARM:DefaultAlarm;
}

// ============================================================================
// MATCH CRITERIA AND CONDITIONS
// ============================================================================

/// Parameter comparison for match criteria
table ParameterComparison {
  /// Parameter reference path
  PARAMETER_REF:string;
  /// Comparison operator
  OPERATOR:ComparisonOperator = EQ;
