  UNITS:[Unit];
  /// Data encoding
  DATA_ENCODING:IntegerDataEncoding;
  /// Minimum valid value
  VALID_MIN:int64;
  /// Maximum valid value
  VALID_MAX:int64;
  /// Signed integer (true) or unsigned (false)
  SIGNED:bool;
  /// Size in bits
  SIZE_IN_BITS:uint16;
  /// Initial/default value
  INITIAL_VALUE:int64;
}

/// Float argument type
table FloatArgumentType {
  /// Type name
  NAME:string;
  /// Short description
  SHORT_DESCRIPTION:string;
  /// Long description
  LONG_DESCRIPTION:string;
  /// Units
  UNITS:[Unit];
  /// Data encoding
  DATA_ENCODING:FloatDataEncoding;
  /// Minimum valid value
  VALID_MIN:double;
  /// Maximum valid value
  VALID_MAX:double;
  /// Size in bits
  SIZE_IN_BITS:uint16;
  /// Initial/default value
