  TELEMETRY_META_DATA:TelemetryMetaData;
  /// Command metadata
  COMMAND_META_DATA:CommandMetaData;
  /// Service definitions
  SERVICE_SET:ServiceSet;
  /// Child space systems (hierarchical structure)
  CHILD_SYSTEMS:[XTC];
}

root_type XTC;
file_identifier "$XTC";

