/// Solid color material
table CZMSolidColorMaterial {
  /// Color
  COLOR:CZMColor;
}

/// Image material
table CZMImageMaterial {
  /// Image URI
  IMAGE:string;
  /// Repeat X
  REPEAT_X:double;
  /// Repeat Y
  REPEAT_Y:double;
  /// Color tint
  COLOR:CZMColor;
  /// Whether the image has transparency
  TRANSPARENT:bool;
}

