  /// Unique identifier
  ID:string;
  /// Reference to parent on-orbit object
  ID_ON_ORBIT:string;
  /// Reference to antenna specification
  ID_ANTENNA:string;
  /// Antenna name or designation
  NAME:string;
  /// Antenna type (e.g., PARABOLIC, PHASED_ARRAY, HORN, HELICAL, DIPOLE, PATCH, YAGI)
  ANTENNA_TYPE:string;
  /// Number of antennas of this type
  QUANTITY:uint;
  /// Operating frequency band (e.g., UHF, L, S, C, X, Ku, Ka, V, W)
  BAND:string;
  /// Minimum operating frequency in MHz
  FREQ_MIN:double;
  /// Maximum operating frequency in MHz
  FREQ_MAX:double;
  /// Antenna gain in dBi
  GAIN:double;
  /// Antenna diameter or aperture in meters
  APERTURE:double;
  /// Beamwidth in degrees
  BEAMWIDTH:double;
  /// Polarization type (e.g., LINEAR, CIRCULAR, DUAL, RHCP, LHCP)
  POLARIZATION:string;
  /// Whether the antenna is steerable
  STEERABLE:bool;
  /// Maximum slew rate in degrees per second
  SLEW_RATE:double;
  /// Purpose or function (e.g., TT_C, PAYLOAD, CROSSLINK, GPS)
  PURPOSE:string;
  /// Additional notes
  NOTES:string;
}

root_type OOA;
file_identifier "$OOA";

TDM.IDL:
// Hash: 3cff136fc81adf1cf217342e255f454a72fa8d922b9231f2a0d93fca5f76519b
// Version: 2.0.1
// -----------------------------------END_HEADER
include "../RFM/main.fbs";

// Based on CCSDS 503.0-B-1 standard, November 2007
//
// Time Reconstruction:
// Individual observation times can be reconstructed using the step-size formula:
//   time[i] = OBSERVATION_START_TIME + (i * OBSERVATION_STEP_SIZE)
// where i is the zero-based index into the observation arrays.
//
/// Tracking Data Message
table TDM {

  /// Unique identifier for the observation OBSERVER -  [Specific CCSDS Document]
  OBSERVER_ID: string;

  /// Cartesian X coordinate of the OBSERVER location in chosen reference frame
  OBSERVER_X: double;

  /// Cartesian Y coordinate of the OBSERVER location in chosen reference frame 
  OBSERVER_Y: double;

  /// Cartesian Z coordinate of the OBSERVER location in chosen reference frame 
  OBSERVER_Z: double;

  /// Cartesian X coordinate of the OBSERVER velocity in chosen reference frame
  OBSERVER_VX: double;

  /// Cartesian Y coordinate of the OBSERVER velocity in chosen reference frame 
  OBSERVER_VY: double;

  /// Cartesian Z coordinate of the OBSERVER velocity in chosen reference frame 
  OBSERVER_VZ: double;

  /// Reference frame used for OBSERVER location Cartesian coordinates (e.g., ECEF, ECI)
  OBSERVER_POSITION_REFERENCE_FRAME: RFM;

  /// Reference frame used for obs location Cartesian coordinates (e.g., ECEF, ECI)
  OBS_REFERENCE_FRAME: RFM;

  /// Epoch time or observation time, in ISO 8601 UTC format -  CCSDS 503.0-B-1
  EPOCH: string;

  /// Time interval between observations in seconds (required).
  /// Time reconstruction: time[i] = OBSERVATION_START_TIME + (i * OBSERVATION_STEP_SIZE)
  OBSERVATION_STEP_SIZE:double;

  /// Start time for observation time reconstruction (ISO 8601 UTC format).
  OBSERVATION_START_TIME:string;

  /// TDM version number -  CCSDS 503.0-B-1, Page D-9
  CCSDS_TDM_VERS: string;

  /// Comments regarding TDM -  various sections, e.g., Page D-9
  COMMENT: [string];

  /// Date of TDM creation -  CCSDS 503.0-B-1, Page D-9
  CREATION_DATE: string;

  /// Originator of the TDM -  CCSDS 503.0-B-1, Page D-9
  ORIGINATOR: string;

  /// Start of metadata section -  CCSDS 503.0-B-1, Page D-9
  META_START: string;

  /// Time system used -  CCSDS 503.0-B-1, Page D-9
  TIME_SYSTEM: string;

  /// Start time of the data -  CCSDS 503.0-B-1, Page D-9
  START_TIME: string;

  /// Stop time of the data -  CCSDS 503.0-B-1, Page D-9
  STOP_TIME: string;

  /// First participant in the TDM -  CCSDS 503.0-B-1, Page D-9
  PARTICIPANT_1: string;

  /// Second participant in the TDM -  CCSDS 503.0-B-1, Page D-9
  PARTICIPANT_2: string;

  /// Third participant in the TDM (if applicable) -  CCSDS 503.0-B-1, Page D-9
  PARTICIPANT_3: string;

  /// Fourth participant in the TDM (if applicable) -  CCSDS 503.0-B-1, Page D-9
  PARTICIPANT_4: string;

  /// Fifth participant in the TDM (if applicable) -  CCSDS 503.0-B-1, Page D-9, max participants
  PARTICIPANT_5: string;

  /// Mode of TDM -  CCSDS 503.0-B-1, Page D-9
  MODE: string;

  /// First path in TDM -  CCSDS 503.0-B-1, Page D-9
  PATH_1: ushort;

  /// Second path in TDM (if applicable) -  CCSDS 503.0-B-1, Page D-9
  PATH_2: ushort;

  /// Transmit band -  CCSDS 503.0-B-1, Page D-9
  TRANSMIT_BAND: string;

  /// Receive band -  CCSDS 503.0-B-1, Page D-9
  RECEIVE_BAND: string;

  /// Integration interval -  CCSDS 503.0-B-1, Page D-9
  INTEGRATION_INTERVAL: float;

  /// Integration reference -  CCSDS 503.0-B-1, Page D-9
  INTEGRATION_REF: string;

  /// Receive delay for second participant -  CCSDS 503.0-B-1, Page D-9
  RECEIVE_DELAY_2: double;

  /// Receive delay for third participant -  CCSDS 503.0-B-1, Page D-9
  RECEIVE_DELAY_3: double;

  /// Data quality -  CCSDS 503.0-B-1, Page D-9
  DATA_QUALITY: string;

  /// End of metadata section -  CCSDS 503.0-B-1, Page D-9
  META_STOP: string;

  /// Start of data section -  CCSDS 503.0-B-1, Page D-9
  DATA_START: string;

  /// Transmit frequency for first participant -  CCSDS 503.0-B-1, Page D-9
  TRANSMIT_FREQ_1: double;

  /// Receive frequency -  CCSDS 503.0-B-1, Page D-9
  RECEIVE_FREQ: [double];

  /// End of data section -  CCSDS 503.0-B-1, Page D-9
  DATA_STOP: string;

  /// Additional properties as required by the specific application of the TDM...
  /// Reference for time tagging -  CCSDS 503.0-B-1, Page D-10
  TIMETAG_REF: string;

  /// Type of angle data -  CCSDS 503.0-B-1, Page D-12
  /// Can be AZEL, RADEC, XEYN, XSYE, or another value with provided ICD
  ANGLE_TYPE: string;

  /// First angle value -  CCSDS 503.0-B-1, Page D-12
  ANGLE_1: [float];

  /// Second angle value -  CCSDS 503.0-B-1, Page D-12
  ANGLE_2: [float];

  /// Uncertainty of first angle -  CCSDS 503.0-B-1
  ANGLE_UNCERTAINTY_1: float;

  /// Uncertainty of second angle -  CCSDS 503.0-B-1
  ANGLE_UNCERTAINTY_2: float;

  /// Rate of change of range -  CCSDS 503.0-B-1
  RANGE_RATE: double;

  /// Uncertainty in range -  CCSDS 503.0-B-1
  RANGE_UNCERTAINTY: double;

  /// Mode of range data -  CCSDS 503.0-B-1, Page D-10
  RANGE_MODE: string;

  /// Modulus value for range data -  CCSDS 503.0-B-1, Page D-10
  RANGE_MODULUS: double;

  /// First correction angle -  CCSDS 503.0-B-1, Page D-12
  CORRECTION_ANGLE_1: float;

  /// Second correction angle -  CCSDS 503.0-B-1, Page D-12
  CORRECTION_ANGLE_2: float;

  /// Indicator of corrections applied -  CCSDS 503.0-B-1, Page D-12
  CORRECTIONS_APPLIED: string;

  /// Dry component of tropospheric delay -  CCSDS 503.0-B-1, Page D-14
  TROPO_DRY: [double];

  /// Wet component of tropospheric delay -  CCSDS 503.0-B-1, Page D-14
  TROPO_WET: [double];

  /// Slant total electron content -  CCSDS 503.0-B-1, Page D-13
  STEC: [double];

  /// Atmospheric pressure -  CCSDS 503.0-B-1, Page D-14
  PRESSURE: [double];

  /// Relative humidity -  CCSDS 503.0-B-1, Page D-14
  RHUMIDITY: [double];

  /// Ambient temperature -  CCSDS 503.0-B-1, Page D-14
  TEMPERATURE: [double];

  /// Clock bias values -  CCSDS 503.0-B-1, Page D-15
  CLOCK_BIAS: [double];

  /// Clock drift values -  CCSDS 503.0-B-1, Page D-15
  CLOCK_DRIFT: [double];
}

root_type TDM;
file_identifier "$TDM";

OCM.IDL:
// Hash: 89b1dd71dff9f6dfc5a7ed28891da2f9e98da024943f0db51b7c69aec18b051c
// Version: 2.0.1
// -----------------------------------END_HEADER
include "../ATM/main.fbs";

// Orbit Comprehensive Message (OCM)
// Description
// The Orbit Comprehensive Message (OCM) is a standardized format used for exchanging detailed
// orbit data between participants. It includes state vectors, physical properties, maneuver information,
// perturbation parameters, covariance data, orbit determination details, and user-defined parameters.
// The OCM is designed to provide a comprehensive set of orbit-related information to support mission
// operations, analysis, and planning activities.
// CCSDS Reference documentation: 502.0-B-3 (April 2023).
//
// COMPACT FORMAT (v2.0.0):
// This schema uses a compact row-major array format for state and covariance data instead of
// individual StateVector objects. This provides significant storage and parsing efficiency for
// time-series ephemeris data with uniform time steps.
//
// State data layout: [X0, Y0, Z0, X_DOT0, Y_DOT0, Z_DOT0, X1, Y1, Z1, X_DOT1, ...]
// Time reconstruction: epoch[i] = METADATA.START_TIME + (i * STATE_STEP_SIZE)
//
// Covariance uses 21 elements per epoch (lower triangular 6x6 matrix) aligned with state epochs.

table Header {
  /// Format version in the form of 'x.y', where 'y' is incremented for minor changes, and 'x' for major changes.
  CCSDS_OCM_VERS: string;
  /// Comments (a contiguous set of one or more comment lines may be provided immediately after the version number).
  COMMENT: [string];
  /// User-defined free-text message classification/caveats of this OCM.
  CLASSIFICATION: string;
  /// File creation date/time in UTC.
  CREATION_DATE: string;
  /// Creating agency or operator.
  ORIGINATOR: string;
  /// Free-text field containing an ID that uniquely identifies a message from this originator.
  MESSAGE_ID: string;
}

table Metadata {
  /// Comments in the Metadata section.
  COMMENT: [string];
  /// Free-text field containing the name of the object.
  OBJECT_NAME: string;
  /// International designator for the object as assigned by COSPAR.
  INTERNATIONAL_DESIGNATOR: string;
  /// Satellite catalog source from which 'OBJECT_DESIGNATOR' was obtained.
  CATALOG_NAME: string;
  /// Unique satellite identification designator from the catalog.
  OBJECT_DESIGNATOR: string;
  /// Alternate names of this space object.
  ALTERNATE_NAMES: [string];
  /// Originator or programmatic Point-of-Contact (PoC) for OCM.
  ORIGINATOR_POC: string;
  /// Contact position of the originator PoC.
  ORIGINATOR_POSITION: string;
  /// Originator PoC phone number.
  ORIGINATOR_PHONE: string;
  /// Originator PoC email address.
  ORIGINATOR_EMAIL: string;
  /// Originator's physical address information.
  ORIGINATOR_ADDRESS: string;
  /// Creating agency or operator for technical contact.
  TECH_ORG: string;
  /// Technical Point-of-Contact (PoC) for OCM.
  TECH_POC: string;
  /// Contact position of the technical PoC.
  TECH_POSITION: string;
  /// Technical PoC phone number.
  TECH_PHONE: string;
  /// Technical PoC email address.
  TECH_EMAIL: string;
  /// Technical PoC physical address information.
  TECH_ADDRESS: string;
  /// ID that uniquely identifies the previous message from this originator.
  PREVIOUS_MESSAGE_ID: string;
  /// ID that uniquely identifies the next message from this originator.
  NEXT_MESSAGE_ID: string;
  /// Unique identifier of Attitude Data Messages linked to this OCM.
  ADM_MSG_LINK: string;
  /// Unique identifier of Conjunction Data Messages linked to this OCM.
  CDM_MSG_LINK: string;
  /// Unique identifier of Pointing Request Messages linked to this OCM.
  PRM_MSG_LINK: string;
  /// Unique identifier of Reentry Data Messages linked to this OCM.
  RDM_MSG_LINK: string;
  /// List of Tracking Data Messages upon which this orbit determination is based.
  TDM_MSG_LINK: [string];
  /// Operator of the space object.
  OPERATOR: string;
  /// Owner of the space object.
  OWNER: string;
  /// Country where the space object owner is based.
  COUNTRY: string;
  /// Name of the constellation to which this space object belongs.
  CONSTELLATION: string;
  /// Specification of the type of object (e.g., PAYLOAD, ROCKET BODY, DEBRIS).
  OBJECT_TYPE: string;
  /// Time system for all absolute time stamps in this OCM, including EPOCH_TZERO.
  TIME_SYSTEM: string;
  /// Default epoch to which all relative times are referenced in data blocks.
  EPOCH_TZERO: string;
  /// Specification of the operational status of the space object.
  OPS_STATUS: string;
  /// Specification of the type of orbit (e.g., GEO, LEO).
  ORBIT_CATEGORY: string;
  /// List of elements of information data blocks included in this message.
  OCM_DATA_ELEMENTS: [string];
  /// Number of spacecraft clock counts at EPOCH_TZERO (used if TIME_SYSTEM is SCLK).
  SCLK_OFFSET_AT_EPOCH: double;
  /// Number of clock seconds occurring during one SI second (used if TIME_SYSTEM is SCLK).
  SCLK_SEC_PER_SI_SEC: double;
  /// Creation epoch of the previous message from this originator.
  PREVIOUS_MESSAGE_EPOCH: string;
  /// Anticipated (or actual) epoch of the next message from this originator.
  NEXT_MESSAGE_EPOCH: string;
  /// Time of the earliest data contained in the OCM.
  START_TIME: string;
  /// Time of the latest data contained in the OCM.
  STOP_TIME: string;
  /// Span of time that the OCM covers, measured in days.
  TIME_SPAN: double;
  /// Difference (TAI - UTC) in seconds at EPOCH_TZERO.
  TAIMUTC_AT_TZERO: double;
  /// Epoch of next leap second.
  NEXT_LEAP_EPOCH: string;
  /// Difference (TAI - UTC) in seconds at NEXT_LEAP_EPOCH.
  NEXT_LEAP_TAIMUTC: double;
  /// Difference (UT1 - UTC) in seconds at EPOCH_TZERO.
  UT1MUTC_AT_TZERO: double;
  /// Source and version of Earth Orientation Parameters used.
  EOP_SOURCE: string;
  /// Method used to select or interpolate sequential EOP data.
  INTERP_METHOD_EOP: string;
  /// Source and version of celestial body ephemeris data used.
  CELESTIAL_SOURCE: string;
}

table StateVector {
  /// Epoch of the state vector.
  EPOCH: string;
  /// X component of position in the specified reference frame.
  X: double;
  /// Y component of position.
  Y: double;
  /// Z component of position.
  Z: double;
  /// X component of velocity.
  X_DOT: double;
  /// Y component of velocity.
  Y_DOT: double;
  /// Z component of velocity.
  Z_DOT: double;
  /// X component of acceleration.
  X_DDOT: double;
  /// Y component of acceleration.
  Y_DDOT: double;
  /// Z component of acceleration.
  Z_DDOT: double;
}

table PhysicalProperties {
  /// Comments in the Physical Properties section.
  COMMENT: [string];
  /// Wet mass of the space object.
  WET_MASS: double;
  /// Dry mass of the space object.
  DRY_MASS: double;
  /// Units for mass values.
  MASS_UNITS: string;
  /// Quaternion component q1 of orientation from OEB to EME2000.
  OEB_Q1: double;
  /// Quaternion component q2.
  OEB_Q2: double;
  /// Quaternion component q3.
  OEB_Q3: double;
  /// Quaternion scalar component qc.
  OEB_QC: double;
  /// Maximum dimension of the object along OEB frame axes.
  OEB_MAX: double;
  /// Intermediate dimension along OEB frame axes.
  OEB_INT: double;
  /// Minimum dimension of the object along OEB frame axes.
  OEB_MIN: double;
  /// Area along OEB_MAX axis.
  AREA_ALONG_OEB_MAX: double;
  /// Area along OEB_INT axis.
  AREA_ALONG_OEB_INT: double;
  /// Area along OEB_MIN axis.
  AREA_ALONG_OEB_MIN: double;
  /// Units for area values.
  AREA_UNITS: string;
  /// Constant area for drag computations.
  DRAG_CONST_AREA: double;
  /// Nominal drag coefficient.
  DRAG_COEFF_NOM: double;
  /// Uncertainty in the drag coefficient.
  DRAG_UNCERTAINTY: double;
  /// Constant area for solar radiation pressure computations.
  SRP_CONST_AREA: double;
  /// Nominal solar radiation pressure coefficient.
  SOLAR_RAD_COEFF: double;
  /// Uncertainty in the solar radiation pressure coefficient.
  SRP_UNCERTAINTY: double;
}

table Perturbations {
  /// Comments in the Perturbations section.
  COMMENT: [string];
  /// Atmospheric model used.
  ATMOSPHERIC_MODEL: ATM;
  /// Gravity model used.
  GRAVITY_MODEL: string;
  /// Degree of the gravity model.
  GRAVITY_DEGREE: int;
  /// Order of the gravity model.
  GRAVITY_ORDER: int;
  /// Gravitational constant times the mass of the central body.
  GM: double;
  /// List of celestial bodies included in n-body perturbations.
  N_BODY_PERTURBATIONS: [string];
  /// Ocean tides model used.
  OCEAN_TIDES_MODEL: string;
  /// Solid tides model used.
  SOLID_TIDES_MODEL: string;
  /// Atmospheric tides model used.
  ATMOSPHERIC_TIDES_MODEL: string;
  /// Geopotential model used.
  GEOPOTENTIAL_MODEL: string;
  /// Solar radiation pressure model used.
  SOLAR_RAD_PRESSURE: string;
  /// Albedo model used.
  ALBEDO: string;
  /// Thermal model used.
  THERMAL: string;
  /// Relativity model used.
  RELATIVITY: string;
  /// Atmospheric drag model used.
  ATMOSPHERIC_DRAG: string;
  /// Fixed geomagnetic Kp index used.
  FIXED_GEOMAG_KP: double;
  /// Fixed F10.7 solar flux value used.
  FIXED_F10P7: double;
  /// Fixed mean F10.7 solar flux value used.
  FIXED_F10P7_MEAN: double;
}

table Maneuver {
  /// Unique identifier for the maneuver.
  MAN_ID: string;
  /// Basis of the maneuver plan (e.g., planned, predicted, estimated).
  MAN_BASIS: string;
  /// Identifier of the maneuver device.
  MAN_DEVICE_ID: string;
  /// Identifier of the previous maneuver.
  MAN_PREV_ID: string;
  /// Purpose of the maneuver.
  MAN_PURPOSE: string;
  /// Reference frame for the maneuver data.
  MAN_REF_FRAME: string;
  /// Epoch of the maneuver reference frame.
  MAN_FRAME_EPOCH: string;
  /// Type of maneuver (e.g., IMPULSIVE, FINITE).
  MAN_TYPE: string;
  /// Start epoch of the maneuver.
  MAN_EPOCH_START: string;
  /// Duration of the maneuver.
  MAN_DURATION: double;
  /// Units for the maneuver data values.
  MAN_UNITS: [string];
  /// Data associated with the maneuver.
  DATA: [string];
  /// Comments related to the maneuver.
  MAN_COMMENT: [string];
}

table OrbitDetermination {
  /// Unique identifier for the orbit determination.
  OD_ID: string;
  /// Identifier of the previous orbit determination.
  OD_PREV_ID: string;
  /// Algorithm used for orbit determination.
  OD_ALGORITHM: string;
  /// Method used for orbit determination.
  OD_METHOD: string;
  /// Epoch of the orbit determination.
  OD_EPOCH: string;
  /// Time tag of the orbit determination.
  OD_TIME_TAG: string;
  /// Process noise model used.
  OD_PROCESS_NOISE: string;
  /// Covariance reduction techniques used.
  OD_COV_REDUCTION: string;
  /// Noise models used.
  OD_NOISE_MODELS: string;
  /// Types of observations used (e.g., RANGE, DOPPLER).
  OD_OBSERVATIONS_TYPE: [string];
  /// Number of observations used.
  OD_OBSERVATIONS_USED: int;
  /// Number of tracks used.
  OD_TRACKS_USED: int;
  /// Data weighting scheme used.
  OD_DATA_WEIGHTING: string;
  /// Convergence criteria used.
  OD_CONVERGENCE_CRITERIA: string;
  /// Parameters estimated during orbit determination.
  OD_EST_PARAMETERS: [string];
  /// A priori data used for orbit determination.
  OD_APRIORI_DATA: string;
  /// Residuals from the orbit determination.
  OD_RESIDUALS: string;
}

table UserDefinedParameters {
  /// Name of the user-defined parameter.
  PARAM_NAME: string;
  /// Value of the user-defined parameter.
  PARAM_VALUE: string;
}

/// Orbit Comprehensive Message
table OCM {
  /// Header section of the OCM.
  HEADER: Header;
  /// Metadata section of the OCM.
  METADATA: Metadata;
  /// Trajectory type (e.g., PROPAGATED, ESTIMATED).
  TRAJ_TYPE: string;

  /// Time interval between state vectors in seconds (required for time-series data).
  STATE_STEP_SIZE:double;

  /// Number of components per state vector.
  /// 6 = position + velocity (X, Y, Z, X_DOT, Y_DOT, Z_DOT)
  /// 9 = position + velocity + acceleration (adds X_DDOT, Y_DDOT, Z_DDOT)
  STATE_VECTOR_SIZE:uint8 = 6;

  /// State data as row-major array of doubles.
  /// Layout: [X0, Y0, Z0, X_DOT0, Y_DOT0, Z_DOT0, X1, Y1, Z1, ...]
  /// Time reconstruction: epoch[i] = METADATA.START_TIME + (i * STATE_STEP_SIZE)
  /// Length must be divisible by STATE_VECTOR_SIZE.
  STATE_DATA:[double];

  /// Covariance data as flat array (21 elements per epoch for 6x6 lower triangular).
  /// Time alignment matches STATE_DATA epochs.
  COVARIANCE_DATA:[double];

  /// Physical properties of the space object.
  PHYSICAL_PROPERTIES: PhysicalProperties;
  /// Maneuver data.
  MANEUVER_DATA: [Maneuver];
  /// Perturbations parameters used.
  PERTURBATIONS: Perturbations;
  /// Orbit determination data.
  ORBIT_DETERMINATION: OrbitDetermination;
  /// User-defined parameters and supplemental comments.
  USER_DEFINED_PARAMETERS: [UserDefinedParameters];
}

root_type OCM;
file_identifier "$OCM";

TKG.IDL:
// Hash: 3857bd488c907c9faeeb3f401d7852b9bd96bcd21d3dbd978ef7212db15aefe0
// Version: 0.0.3
// -----------------------------------END_HEADER
enum FilterType : byte {
  ALPHA_BETA,
  ALPHA_BETA_GAMMA,
  KALMAN,
  EXTENDED_KALMAN,
  UNSCENTED_KALMAN,
  PARTICLE,
  IMM,                    // Interacting Multiple Model,
  JPDA,                   // Joint Probabilistic Data Association,
  MHT,                    // Multiple Hypothesis Tracking,
  GNN,                    // Global Nearest Neighbor,
  NNKF                    // Nearest Neighbor Kalman Filter
}

enum MotionModel : byte {
  CONSTANT_VELOCITY,
  CONSTANT_ACCELERATION,
  COORDINATED_TURN,
  SINGER_ACCELERATION,    // Singer maneuver model,
  JUMP_MARKOV,           // Jump Markov acceleration,
  BALLISTIC,
  ORBITAL,
  SURFACE_VEHICLE,
  CURVILINEAR
}

enum MeasurementType : byte {
  POSITION_3D,            // [x, y, z],
  POSITION_2D,            // [x, y],
  RANGE_BEARING,          // [r, az],
  RANGE_BEARING_ELEVATION,// [r, az, el],
  RANGE_ONLY,
  BEARING_ONLY,
  RANGE_RATE,             // Doppler,
  ANGLES_ONLY,            // [az, el],
  TLE,                    // Two-line elements,
  GPS,                    // GPS measurement,
  RADAR,                  // Combined radar measurement,
  ADSB,                   // ADS-B position,
  SONAR                   // Sonar bearing/range
}

enum TkgTrackStatus : byte {
  TENTATIVE,              // Initial detections,
  CONFIRMED,              // Confirmed track,
  COASTING,               // No recent update,
  LOST,                   // Track lost,
  DELETED                 // Track deleted
}

enum AssociationMethod : byte {
  NEAREST_NEIGHBOR,
  GLOBAL_NEAREST_NEIGHBOR,
  PROBABILISTIC_DATA,     // PDA,
  JOINT_PROBABILISTIC,    // JPDA,
  AUCTION,
  HUNGARIAN,
  MUNKRES
}

enum FusionMethod : byte {
  SIMPLE_AVERAGE,
  WEIGHTED_AVERAGE,
  COVARIANCE_INTERSECTION,
  BAR_SHALOM_CAMPO,
  FEDERATED,
  SEQUENTIAL
}

/// Tracking and Data Fusion
table TKG {
  COMMAND:string;
  FILTER_CONFIG:string;
  IMM_CONFIG:string;
  MHT_CONFIG:string;
  JPDA_CONFIG:string;
